import React from "react";

export const Header = () => {
  return (
    <div className=" bg-orange w-full h-7 flex justify-between items-center">
      <div className="flex">
        <div className="border border-white w-6 h-6 flex items-center justify-center ]">
          <img className="w-fit h-5" src="/assets/hacker.svg" />
        </div>
        <span className="font-bold"> Hacker news</span>
        <button>new </button> <span> |</span>
        <button>past </button> <span> |</span>
        <button>comm </button> <span> |</span>
        <button>new </button> <span> |</span>
      </div>

      <div></div>
    </div>
  );
};
